import React from "react";
import GenderCardStyle from "./GenderCardStyled";

const GenderCard = (props) =>
{

  if(props.gender.length > 0){
    }else if(props.gender[0].gender){
      return(
      <GenderCardStyle>
        <div className="row">
          <h1>
            {props.gender[0].name} is {props.gender[0].gender}
          </h1>
        </div>
      </GenderCardStyle>
    )
  }else if(!props.gender[0].gender){
    return(
    <GenderCardStyle>
      <div className="row">
        <h1>
          {props.gender[0].name} IS NULL
        </h1>
        <h3>
          {props.gender[0].name} is  {props.gender[0].gender}
        </h3>
      </div>
    </GenderCardStyle>
  )



}else{
      return(
      <GenderCardStyle>
        <div className="row">
          <h1>
            Loading Gender...
          </h1>
        </div>
      </GenderCardStyle>
    )
    }
  };

export default GenderCard;
